import React, { Component } from 'react';
import { Text, View } from 'react-native';

class Home extends Component {


    cardRenderer = () => this.props.users.map()

    render() {
        console.log("profile",this.props.users)
        return (
            <View>
                {this.cardRenderer}
            </View>
        );
    }
}

export default Home;
